document.addEventListener("DOMContentLoaded",(()=>{document.querySelectorAll(".table__row").forEach((e=>{e.addEventListener("click",(e=>{let t=document.querySelector(".table__row.active");t&&t.classList.toggle("active"),e.target.closest(".table__row").classList.toggle("active")}))})),document.querySelectorAll(".highcharts-figure").forEach((e=>{let t=e.firstElementChild.id,l=e.getAttribute("data-highcharts-series").split(",").map(Number);highchartsFigure(l,t)}))}));const highchartsFigure=(e,t)=>Highcharts.chart(t,{title:!1,subtitle:!1,tooltip:{enabled:!1},chart:{type:"line",backgroundColor:"transparent"},yAxis:{title:{text:!1},labels:{enabled:!0},min:0},xAxis:{title:{text:!1},labels:{enabled:!0}},series:[{data:e}]});